import React from "react";
import Todo from "./Todo";
import { useTodo } from "./TodoProvider";

export default function TodoList() {
  const { todo } = useTodo();
  return (
    <table>
      <tbody>
        {todo.map((todo, i) => (
          <Todo key={i} {...todo} />
        ))}
      </tbody>
    </table>
  );
}
